import { Log } from '../../../Logging-Middleware';

/**
 * A simplified logger interface for use within the React application.
 * It provides methods for different log levels, abstracting the direct
 * call to the core Log function for cleaner integration.
 */
const Logger = {
    info: (pkg, message) => Log('info', pkg, message),
    warn: (pkg, message) => Log('warn', pkg, message),
    error: (pkg, message) => Log('error', pkg, message),
    debug: (pkg, message) => Log('debug', pkg, message),
};

export default Logger;
